export enum AccountActionType {
    ADD_DATA_LIST = "ADD_DATA_LIST",
    ADD_HISTORY_ORDER = "ADD_HISTORY_ORDER",
    ENTER_LOGIN = "ENTER_LOGIN",
}

export interface AccountState {
    dataList: {
        phone?: string,
        username?: string,
        surname?: string,
        firstName?: string,
        middleName?: string
        password?: string,
        deliveryMethod?: string,
        addressNovaPoshta?:{
            postOffice: string,
            city: string,
            street: string,
            number: string,
        },
        addressUkrPoshta?: {
            region: string,
            district: string,
            city: string,
            street: string,
            number: string,
            zipcode: string,
        }
    },

    historyOrder: [{
        id: string,
        date: any,
        productList: [{
            id: string,
            price: number,
            stateQuantity: number,
            name: string,
            quantity: number
        }],
        totalCost: number,
    }],

    login: {
        phone: string,
        password: string,
        login: boolean,
        registration?: boolean
    }
}


interface AccountDataListAction {
    type: AccountActionType.ADD_DATA_LIST;
    payload: {
        phone?: string,
        username?: string,
        surname?: string,
        firstName?: string,
        middleName?: string
        password?: string,
        deliveryMethod?: string,
        addressNovaPoshta?:{
            postOffice: string,
            city: string,
            street: string,
            number: string,
        },
        addressUkrPoshta?: {
            region: string,
            district: string,
            city: string,
            street: string,
            number: string,
            zipcode: string,
        },
    };
}

interface AccountHistoryOrderAction {
    type: AccountActionType.ADD_HISTORY_ORDER;
    payload: {
        id: string,
        date: any,
        productList: [{
            id: string,
            price: number,
            stateQuantity: number,
            name: string,
            quantity: number
        }],
        totalCost: number,
    };
}

interface AccountLoginAction {
    type: AccountActionType.ENTER_LOGIN;
    payload: {phone: string, password: string, login: boolean, registration?: boolean};
}


export type AccountAction =       AccountDataListAction
                                | AccountHistoryOrderAction
                                | AccountLoginAction
